return (<>

 <Menu/>
<Switch>
    <Route exact path="/" component={About}/>
    <Route path= "/contact" component = {Contact}   />
    
    <Route exact path= "/user/:fname" component = {User}   />
    <Route   component = {Service}/>
</Switch>


</>);

}

export default App;
